  input: TEXT,F3XN,,"1.  We have several credit unions who serve the PAC as collection
    agents.                      a.  There are several ways they serve.  One way is
    that they employees have moeny withheld from their payroll and contribute it to
    the PAC.  These amounts are tallied and none have exceeded the limit to be disclosed.                                                   b.  A
    second way is through our sales.  We have cookbooks and coins which the credit
    union sale for us.  The credit union sends us the gross sale, and then we reimburse
    the credit union for the total cost of the products.  Therefore, there is no interference
    with the 1/3rd rule."
